ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Mercedes-Benz C220 wyprodukowany w 2003 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 2148 cm3, legitymujący się mocą 143 KM, który pokonał do tej pory 218000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie wymaga wymiany dwoch przedniczh wagaczy, układ kierowniczy jest precyzyjny. Wizualnie Mercedes prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji, jest do lekkich poprawek. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane.



Mercedes jest wyposażenia w:

- Klimatyzację dwustrefową;

- Nawigacja, z dużym wswietlaczem;

- Skórzaną tapicerke;

- Alufelg;

- Skórzana tapicerka

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie;

- Elektryczne lusterka;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 25.06.2025 roku.

Przegląd techniczny 04.06.2026 roku.
